import logo from './logo.svg';
import './App.css';

const intro = "yayaypyappyapyapyap";

function App() {
  return (
    <div>
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Skill Scope
          </p>
        </header>
      </div>
      <div className="App">
      <header className="App-text">
        <p>
          {intro}
        </p>
      </header>
    </div>
  </div>
  );
}

export default App;
